import { MessageList } from 'react-chat-elements'
import React from 'react';

function Message(props) {
    return(
        <MessageList
    className='message-list'
    lockable={true}
    toBottomHeight={'100%'}
    dataSource={[
        {
            position: 'right',
            type: 'text',
            text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit',
            date: new Date(),
        },
    ]} />
    )
}

export default Message
